/// <summary>
/// Updating vendor code lookpus from BE0X and Legacy code loookups
/// </summary>
protected void updateVendorCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case 'US-WF-PMS-XML-R1201212':
            if(gSKS_EFT_VendorPaym.BE01)
            {
                this.updateVendorFields('TradingPartnerId', gSKS_EFT_VendorPaym.BE01);
            }

            if(gSKS_EFT_VendorPaym.BE02)
            {
                this.updateVendorFields('BusinessFuncCode', gSKS_EFT_VendorPaym.BE02);
            }

            if(gSKS_EFT_VendorPaym.WBeneMailHandling)
            {
                this.updateVendorFields('DeliveryCode', gSKS_EFT_VendorPaym.WBeneMailHandling, true);
            }

            if(gSKS_EFT_VendorPaym.WBeneAdvice)
            {
                this.updateVendorFields('TranHandlingCode', gSKS_EFT_VendorPaym.WBeneAdvice, true);
            }
            break;
    }
}

/// <summary>
/// Updating the bank code lookpups from the W0X fields.
/// </summary>
protected void updateBankCodelookupValues()
{
    switch(gSKS_EFT_FileFormat.FormatId)
    {
        case 'US-WF-PMS-XML-R1201212':
            if(gSKS_EFT_Bank.W01)
            {
                this.updateBankFields('CheckFaceStyleId', gSKS_EFT_Bank.W01);
                this.updateBankFields('CustomerID', gSKS_EFT_Bank.W01);
                this.updateBankFields('OrgnrDepAcctID', gSKS_EFT_Bank.W01);
            }

            if(gSKS_EFT_Bank.W02)
            {
                this.updateBankFields('WireRoutngNumber', gSKS_EFT_Bank.W02);
                this.updateBankFields('OrgDepAcct', gSKS_EFT_Bank.W02, true);
            }

            if(gSKS_EFT_Bank.W03)
            {
                this.updateBankFields('ReferenceTypeCode', gSKS_EFT_Bank.W03);
            }

            if(gSKS_EFT_Bank.W04)
            {
                this.updateBankFields('EDDBillerID', gSKS_EFT_Bank.W04);
            }
            break;
    }
}
